import { Fragment } from 'react';
import './App.css';
import Nav from './Components/Nav';
import Body from './Components/Body';
import CssBaseline from '@mui/material/CssBaseline';

function App() {
  return (
   <Fragment>
     <CssBaseline />
     <Nav/>
     <Body/>
   </Fragment>
  );
}

export default App;
